column8:
★ナイキのキッズ用カラフルサンダル！<br>
<br>
●暑い日に適したキッズ用サンダルです！<br>
●Phylonミッドソール採用で軽量かつ高いクッショニング効果を実現、成形アウトソールが優れたトラクションを発揮。<br>
●つま先まで覆うラバーが足を保護。<br>
●マジックテープでサイズ調整ができ、快適な履き心地です。<br>
<br>
■素材<br>
アッパー：人工皮革<br>
アウトソール：ゴム底<br>
■企画製造販売元 株式会社ナイキジャパン<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<BR>
<BR>
■サイズ 12.0cm、13.0cm、14.0cm、15.0cm、16.0cm<br>
